import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className='home'>
        <div className='home-main'>
            <div className='cont'>
                <h1>Welcome To SnapLib Photography</h1>
                <p>Capture your best memories with our Exoert Photographers.</p>
            </div>
        </div>
    </div>
  )
}

export default Home;
